import React from "react";
import './App.css'
import {
  InfoWindow,
  withScriptjs,
  withGoogleMap,
  GoogleMap,
  Marker,
} from "react-google-maps";

import Geocode from "react-geocode";
import { throwStatement } from "@babel/types";
import { Descriptions } from 'antd';
import AutoComplete from 'react-google-autocomplete'
import Axios from 'axios'
import QueueDriver from "./component/QueueDriver";
Geocode.setApiKey("AIzaSyDrjHmzaE-oExXPRlnkij2Ko3svtUwy9p4");


class App extends React.Component {
  timeoutId1=0;
  timeoutId2=0;
  state = {
    address: '',
    city: '',
    area: '',
    state: '',
    zoom: 15,
    height: 400,
    mapPosition: {
      lat: 13.84839475068859,
      lng: 100.56908802639256,
    },
    markerPosition: {
      lat: 0,
      lng: 0,
    },
    markerDestinationPosition:{
      lat:0, 
      lng:0,
    },
    locationList:[],
    queueDriverAppear:1,
  }

  updateStatus = () =>{
    fetch("http://localhost:1234/response")
      .then(response=> response.json())
      .then(data=>{
        console.log(data[0]);
        if(data[0].status ==="false"){
            fetch("http://localhost:1234/response/1",{
                method: 'put',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify({
                    "id": 1,
                    "status": "true",
                })
            })
            .catch(err => console.log(err));
        }
      })
  }




  getLocation = () => {


    fetch("http://localhost:1236/location")
        .then(response=> response.json())
        .then(data => {
          if(data[0].status ==='true'){
              this.updateStatus();
              this.setState({
                  markerPosition: {
                    lat: data[0].latitudeStart,
                    lng: data[0].longtitudeStart,
                  },
                  markerDestinationPosition: {
                    lat: data[0].latitudeDestination,
                    lng: data[0].longtitudeDestination,
                  },
                  queueDriverAppear:null,         
             });

          }
      })
  //   Axios.get('http://localhost:3001/location').then((response) => {
  //     this.setState(state=>{
  //         this.state.locationList = response.data;

  //     })
  //     this.setState({
  //       markerPosition: {
  //         lat: parseFloat(this.state.locationList[this.state.locationList.length-1].LatitudeStart),
  //         lng: parseFloat(this.state.locationList[this.state.locationList.length-1].LongtitudeStart),
  //       },
  //       markerDestinationPosition: {
  //         lat: parseFloat(this.state.locationList[this.state.locationList.length-1].LatitudeDestination),
  //         lng: parseFloat(this.state.locationList[this.state.locationList.length-1].LongtitudeDestination),
  //       },
  //       queueDriverAppear:null,

  //     })
  //   });
    }


  queueDriver = null;

  render() {
        if(!!this.state.queueDriverAppear){
          this.queueDriver= <QueueDriver getLocation={this.getLocation} timeoutId1={this.timeoutId1} timeoutId2={this.timeoutId2}/>
        }
        else{
          this.queueDriver= null;
          clearInterval(this.timeoutId1);
          clearInterval(this.timeoutId2);
        }

        const MapWithAMarker = withScriptjs(withGoogleMap(props =>
          <GoogleMap

          defaultZoom={15}
          defaultCenter={{ lat:this.state.mapPosition.lat, lng: this.state.mapPosition.lng }}


          defaultOptions={{

            zoomControl:true,
            scrollwheel:true,
            streetViewControl: false,
            draggable:true,
            minZoom:15,
            // maxZoom:16,
            mapTypeControl:false,
            restriction:{
              latLngBounds:{
                north: this.state.mapPosition.lat+ 0.012,
                south: this.state.mapPosition.lat - 0.012,
                east: this.state.mapPosition.lng + 0.012,
                west: this.state.mapPosition.lng - 0.012,
              },
              strictBounds: false,
            },
          }}
          >

        <Marker
          draggable={false}
          // onDragEnd={this.onMarkerDragEnd}
          position={{ lat: this.state.markerPosition.lat, lng: this.state.markerPosition.lng }}

        >
        </Marker>
        <Marker 

            icon={{
              url:"/pictures/markerGreen.png",
              scaledSize:{height: 40 , width: 27},
            }}

            position={{ lat: this.state.markerDestinationPosition.lat, lng: this.state.markerDestinationPosition.lng }}

            >  
          </Marker>
          <button className="finish-button" >Done</button>





      </GoogleMap>
    ));
    return (
      <section className="app-section">

        <div style={{ padding: '1rem', margin: '0 auto', maxWidth: 600 }}>
        {this.queueDriver}
          <h1>Driver</h1>

          {/* <Descriptions bordered>
            <Descriptions.Item label="City">{this.state.city}</Descriptions.Item>
          <Descriptions.Item label="Area">{this.state.area}</Descriptions.Item>
          <Descriptions.Item label="State">{this.state.state}</Descriptions.Item>
            <Descriptions.Item label="Address">{this.state.address}</Descriptions.Item>
          </Descriptions> */}
          <MapWithAMarker
                googleMapURL="https://maps.googleapis.com/maps/api/js?key=AIzaSyDrjHmzaE-oExXPRlnkij2Ko3svtUwy9p4&v=3.exp&libraries=geometry,drawing,places"
                loadingElement={<div style={{ height: `100%` }} />}
                containerElement={<div style={{ height: `400px` }} />}
                mapElement={<div style={{ height: `100%` }} />}
              /> 

        </div>

      </section>

    );
  }
}

export default App;
